//כרטיסים בחבילה
//הקומפוננטה נמצאת בתוך תמחור מכירה
import React, { useState } from 'react'
const Packages = () => {
    //חבילות
    let percentage;
    let [qty, setQty] = useState(0);
    return (
        <form>
            <h1>Packages</h1>
            {/* חבילת רכישה היא כמות כרטיסים ממכלול הכרטיסים במכירה הפומבית,
             במחיר מוזל לפי אחוזי ההנחה שתקבע */}
            <label>Purchase package is the quantity of tickets from the set of tickets at the auction,
                 at a discounted price according to the percentage of the discount you will determine</label>
            <div className="ui equal width form">
                <div className="fields">
                    <div className="field">
                        <label>Quantity of tickets</label>
                        <input type="number" onChange={(e) => { setQty(e.target.value) }} />
                    </div>
                    <div className="field">
                        <label>Discount percentages</label>
                        <input type="number" onChange={(e) => { percentage = e.target.value }} required={(qty > 0)} />
                    </div>
                </div>
            </div>
            <button className="positive ui button">ok</button>
        </form>
    );
}

export default Packages;
